import './App.css';

function App() {

  return (
    <div className="App">
      <Router>
      <Routes>
        <Route path="/" element={<HomePage />} /> {/* Home Page */}
        <Route path="/chatbot" element={<ChatbotPage />} /> {/* Chatbot Page */}
        <Route path="/about" element={<AboutPage />} /> {/* About Us Page */}
        <Route path="/features" element={<FeaturesPage />} /> {/* Features Page */}
        <Route path="/contact" element={<ContactPage />} /> {/* Contact Us Page */}
      </Routes>
    </Router>




    </div>
  );
}

export default App;
